  `tel` char(11) DEFAULT NULL COMMENT '手机号',
  `email` varchar(30) DEFAULT NULL COMMENT '邮箱',
  `sort` tinyint(3) unsigned DEFAULT NULL COMMENT '排序',
  PRIMARY KEY (`id`)
